import React from 'react'

function GetCurrentData() {

    let timeUpdate = document.getElementById('timeUpdate').innerHTML;
    timeUpdate = new Date();
    timeUpdate = timeUpdate.toLocaleDateString("ru-RU");
    document.getElementById('timeUpdate').innerHTML = timeUpdate;
  return (
    <div>GetCurrentData</div>
  )
}

export default GetCurrentData
